import { WeatherApi } from "../../src/api/api"


let getMachineListAPI = async () => {
    try {
        let Item = await WeatherApi();
        console.log(Item.data);
    } catch (error) {
        console.log("異常", error);
    }
}

export function Weather() {
    setTimeout(() => {
        getMachineListAPI();
    }, 100);
    return <div>天氣預測</div>
}
